import Login from './components/Login.';
import Signup from './components/Signup';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom"

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>

          <Route path="/" exact>
            <Login/>
          </Route>

          <Route path="/signup" exact>
          <Signup/>
          </Route>

        </Routes>
      </Router>

    </div>
  );
}

export default App;
